// import Layout from "../components/layout";
import { Table } from "../components/antd";
import { useState } from "react";
import { Menu, Dropdown } from 'antd';
import { DownOutlined } from '@ant-design/icons';


export const Home = (props) => {
  const storagePowerData = props;
  const [selectedRowKeys, setSelectedRowKeys] = useState([]);

  const rowSelection = {
    selectedRowKeys,
    onChange: setSelectedRowKeys,
  };

  const menu = (
    <Menu>
      <Menu.Item>
        <a target="_blank" rel="noopener noreferrer" href="http://www.alipay.com/">
          Africa
        </a>
      </Menu.Item>
      <Menu.Item>
        <a target="_blank" rel="noopener noreferrer" href="http://www.taobao.com/">
          Asia
        </a>
      </Menu.Item>
      <Menu.Item>
        <a target="_blank" rel="noopener noreferrer" href="http://www.tmall.com/">
          Europe
        </a>
      </Menu.Item>
    </Menu>
  );

  const columns = [
    {
      title: "Miner Id",
      dataIndex: "minerId",
    },
    {
      title: "Raw Byte Storage Capacity",
      dataIndex: "rbsc",
    },
    {
      title: "Sector Quality",
      dataIndex: "sectorQuality",
    },
    {
      title: "Deal Success Rate",
      dataIndex: "dealSuccessRate",
    },
  ];

  const tableData = [
    {
      minerId: "t03984 - Genius Rig",
      rbsc: "313.22TB",
      sectorQuality: "43%",
      dealSuccessRate: "90%",
    },
    {
      minerId: "t0333",
      rbsc: "50TB",
      sectorQuality: "12%",
      dealSuccessRate: "4%",
    },
    {
      minerId: "t03984 - wethemboyz",
      rbsc: "313.22TB",
      sectorQuality: "43%",
      dealSuccessRate: "90%",
    },
    {
      minerId: "t03984 - hellokittty321321",
      rbsc: "313.22TB",
      sectorQuality: "43%",
      dealSuccessRate: "90%",
    },
    {
      minerId: "t03984 ",
      rbsc: "313.22TB",
      sectorQuality: "43%",
      dealSuccessRate: "90%",
    },
    {
      minerId: "t03984 - apfelwein",
      rbsc: "313.22TB",
      sectorQuality: "43%",
      dealSuccessRate: "90%",
    },
  ];

  return (
    <>
      <div>
        <span>
          <h1>Storage Power</h1>
          <DropDown overlay={menu}/>
        </span>
        <Table
          rowSelection={rowSelection}
          columns={columns}
          dataSource={tableData}
          pagination={true}
          style={{ width: "40%" }}
        />
      </div>
    </>
  );
};

export default Home;
